/* eslint-disable prettier/prettier */
import styled from 'styled-components'
// import Sheikh from '../assets/Images/sheikhdahir1.png'

const Main = () =>  (
    <Wrapper>
       <TextWrapper>
           <SmallHeading>Trending</SmallHeading>
           <BigHeading>Darikar Tijjaniyya ba bidi'a bane</BigHeading>
            <ButtonWrapper>Play</ButtonWrapper>

       </TextWrapper>
        <img src="/sheikhdahir2.png" height="100%" width="60%" alt="Shehu Dahiru"/>
    </Wrapper>
)
const Wrapper = styled.div`

width:100%;
display:flex;
justify-content:space-between;
height:307px;
background-color:#309f5e;
margin-left:-30px;
margin-right:-15px;
margin-top:30px;
`
const TextWrapper = styled.section`
position:relative;
top:120px;
left:90px;
`
const SmallHeading = styled.h3`
color:white;
font-size:24px;
`
const BigHeading = styled.h1`
color:white;
font-size:32px;
font-weight:bold;
`
const ButtonWrapper = styled.button`
font-size:${16/16}rem;
padding:4px 12px;
border-radius:2px;
width:104px;
font-weight:bold;
background-color:white;
border:2px solid transparent;
color:#309f5e;
`
const Heading = styled.h1`
color:white;
width:min-content;
font-size:32px;
position:absolute;
top:20px;
left:40px;
`
export default Main;
